INSERT INTO `%DB_PREFIX%deal_msg_list` VALUES ('4160','fanwe@fanwe.net','1','<div style=\"width: 98%;text-align: right;\">\r\n编号：<span>Z-788</span>\r\n</div>\r\n <h2 align=\"center\">债权转让及受让协议</h2>\r\n\r\n<br/>\r\n<div> \r\n\r\n　　　本债权转让及受让协议（下称“本协议”）由以下双方于签署：\r\n</p>\r\n</div>\r\n<br/>\r\n<div> \r\n<p style=\"text-align: left;font-weight: 600;\">甲方（转让人）：张三</p>\r\n<p>身份证号：350020198010091020</p>\r\n<p>p2p信贷用户名：fanwe</p>\r\n</div>\r\n <br/>\r\n<div> \r\n<p style=\"text-align: left;font-weight: 600;\">乙方（受让人）：测试</p>\r\n<p>身份证号：431221199108023012</p>\r\n<p>p2p信贷用户名：admin</p>\r\n</div>\r\n <br/>\r\n <p>就甲方通过p2p信贷商务顾问（北京）有限公司（以下“p2p信贷”系指p2p信贷商务顾问（北京）有限公司和下述p2p信贷网站的统称）运营管理的t2.fanwe.net 网站（下称“p2p信贷网站”）向乙方转让债权事宜，双方经协商一致，达成如下协议：</p>       \r\n<br/>\r\n<p style=\"text-align: left;font-weight: 600;\">1.  债权转让</p>\r\n<p>1.1  标的债权信息及转让</p>     <p>甲方同意将其通过p2p信贷的居间协助而形成的有关债权（下称“标的债权”）转让给乙方，乙方同意受让该等债权。标的债权具体信息如下：<p>\r\n<p style=\"text-align: left;font-weight: 600;\">标的债权信息：</p>\r\n<br/>\r\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\r\n<tr>\r\n  <td width=\"20%\" style=\"padding-left:10px\">借款ID</td>\r\n <td style=\"padding-left:10px\">788</td>\r\n</tr>\r\n<tr>\r\n  <td style=\"padding-left:10px\">借款人姓名</td>\r\n  <td style=\"padding-left:10px\">张三</td>\r\n</tr>\r\n<tr>\r\n  <td style=\"padding-left:10px\">借款本金数额</td>\r\n <td style=\"padding-left:10px\">\r\n    ￥51.00                                                                      \r\n </td>\r\n</tr>\r\n<tr>\r\n  <td style=\"padding-left:10px\">借款年利率</td>\r\n  <td style=\"padding-left:10px\">14.00%</td>\r\n</tr>\r\n<tr>\r\n  <td style=\"padding-left:10px\">原借款期限</td>\r\n  <td style=\"padding-left:10px\">\r\n	1 个月，2015 年 01 月 13 日 起，至 2015 年 02 月 13 日止</td>\r\n</tr>\r\n<tr>\r\n  <td style=\"padding-left:10px\">月偿还本息数额</td>\r\n  <td style=\"padding-left:10px\">\r\n  ￥51.59  </td>\r\n</tr>\r\n<tr>\r\n  <td style=\"padding-left:10px\">还款日</td>\r\n  <td style=\"padding-left:10px\">\r\n    2015 年 01 月 13 日 自起，每月 13 日（24:00前，节假日不顺延）\r\n </td>\r\n</tr>\r\n</table>\r\n<p style=\"text-align: left;font-weight: 600;\">标的债权转让信息</p>\r\n<br/>\r\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\r\n<tr>\r\n  <td width=\"20%\" style=\"padding-left:10px\">标的债权价值</td>\r\n <td style=\"padding-left:10px\">\r\n	￥51.59                                             \r\n   </td>\r\n</tr>\r\n<tr>\r\n  <td style=\"padding-left:10px\">转让价款</td>\r\n <td style=\"padding-left:10px\">\r\n	￥51.00                                                        \r\n  </td>\r\n</tr>\r\n<tr>\r\n  <td style=\"padding-left:10px\">转让管理费</td>\r\n  <td style=\"padding-left:10px\">\r\n		￥51.00  </td>\r\n</tr>\r\n<tr>\r\n  <td style=\"padding-left:10px\">转让日期</td>\r\n <td style=\"padding-left:10px\">2015 年 01 月 27 日</td>\r\n</tr>\r\n<tr>\r\n  <td style=\"padding-left:10px\">剩余还款分期月数</td>\r\n <td style=\"padding-left:10px\">\r\n    1 个月，2015 年 01 月 13 日 起，至  2015 年 02 月 13 日 止 \r\n </td>\r\n</tr>\r\n</table>\r\n<br/>\r\n<p>1.2  债权转让流程</p>\r\n<p>1.2.1  双方同意并确认，双方通过自行或授权有关方根据p2p信贷网站有关规则和说明，在p2p信贷网站进行债权转让和受让购买操作等方式确认签署本协议。</p>\r\n<p>1.2.2  双方接受本协议且p2p信贷审核通过时，本协议立即成立,并待转让价款支付完成时生效。协议成立的同时甲方不可撤销地授权p2p信贷自行或委托第三方支付机构或合作的金融机构，将转让价款在扣除甲方应支付给p2p信贷的转让管理费之后划转、支付给乙方，上述转让价款划转完成即视为本协议生效且标的债权转让成功；同时甲方不可撤销地授权p2p信贷将其代为保管的甲方与标的债权借款人签署的电子文本形式的《借款协议》（下称“借款协议”）及借款人相关信息在p2p信贷网站有关系统板块向乙方进行展示。</p>\r\n<p>1.2.3  本协议生效且标的债权转让成功后，双方特此委托p2p信贷将标的债权的转让事项及有关信息通过站内信等形式通知与标的债权对应的借款人。</p>\r\n<p>1.3  自标的债权转让成功之日起，乙方成为标的债权的债权人，承继借款协议项下出借人的权利并承担出借人的义务。</p>\r\n<br/>\r\n<p style=\"text-align: left;font-weight: 600;\">2.  保证与承诺</p>\r\n<p>2.1  甲方保证其转让的债权系其合法、有效的债权，不存在转让的限制。甲方同意并承诺按有关协议及p2p信贷网站的相关规则和说明向p2p信贷支付债权转让管理费。</p>\r\n<p>2.2  乙方保证其所用于受让标的债权的资金来源合法，乙方是该资金的合法所有人。如果第三方对资金归属、合法性问题发生争议，乙方应自行负责解决并承担相关责任。</p><br/>\r\n<p style=\"text-align: left;font-weight: 600;\">3.  违约</p>\r\n<p>3.1  双方同意，如果一方违反其在本协议中所作的保证、承诺或任何其他义务，致使其他方遭受或发生损害、损失等责任，违约方须向守约方赔偿守约方因此遭受的一切经济损失。</p>\r\n<p>3.2  双方均有过错的，应根据双方实际过错程度，分别承担各自的违约责任。</p><br/>\r\n<p style=\"text-align: left;font-weight: 600;\">4.  适用法律和争议解决</p>\r\n<p>4.1  本协议的订立、效力、解释、履行、修改和终止以及争议的解决适用中国的法律。</p>\r\n<p>4.2  本协议在履行过程中，如发生任何争执或纠纷，双方应友好协商解决；若协商不成，任何一方均有权向有管辖权的人民法院提起诉讼。</p><br/>\r\n<p style=\"text-align: left;font-weight: 600;\">5.  其他</p>\r\n<p>5.1  双方可以书面协议方式对本协议作出修改和补充。经过双方签署的有关本协议的修改协议和补充协议是本协议组成部分，具有与本协议同等的法律效力。</p>\r\n<p>5.2  本协议及其修改或补充均通过p2p信贷网站以电子文本形式制成，可以有一份或者多份并且每一份具有同等法律效力；同时双方委托p2p信贷代为保管并永久保存在p2p信贷为此设立的专用服务器上备查。双方均认可该形式的协议效力。</p>\r\n<p>5.3  甲乙双方均确认，本协议的签订、生效和履行以不违反中国的法律法规为前提。如果本协议中的任何一条或多条违反适用的法律法规，则该条将被视为无效，但该无效条款并不影响本协议其他条款的效力。</p>\r\n<p>5.4  除本协议上下文另有定义外，本协议项下的用语和定义应具有p2p信贷网站服务协议及其有关规则中定义的含义。若有冲突，则以本协议为准。</p>\r\n</div>\r\n  <br>\r\n<div style=\"width: 98%;text-align: right;\">\r\n	<p>\r\n		2015 年 01 月 27 日	</p>\r\n</div>','1422336202','1','1422336196','44','','1','1','债权“Z-788”的电子协议！','0','0');
