INSERT INTO `%DB_PREFIX%deal_msg_list` VALUES ('4386','fanwe@fanwe.net','1','<p>尊敬的用户fanwe：&nbsp; </p>\r\n<p>很高兴的通知您，您于2015年02月11日所投的借款“贷款测试zj9”满标，您的本次投标行为成功。&nbsp;</p>\r\n<br>\r\n<br>\r\n<p>点击 <a href=\"http://t2.fanwe.net/borrow\">这里</a>查看您所发布借款。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\r\n<p>感谢您对我们的支持与关注。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\r\n<p>p2p信贷&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\r\n<p>注：此邮件由系统自动发送，请勿回复！&nbsp; </p>\r\n<p>如果您有任何疑问，请您查看 <a href=\"http://t2.fanwe.net/helpcenter\" target=\"_blank\">帮助</a>，或访问 <a href=\"http://t2.fanwe.net\" target=\"_blank\">客服中心</a></p>\r\n<p>如果您觉得收到过多邮件，可以点击 <a href=\"http://t2.fanwe.net/uc_msg-setting\" target=\"_blank\">这里</a>进行设置\r\n&nbsp; </p>','1423609261','1','1423609258','44','','1','1','您的所投的借款“贷款测试zj9”已满标！','0','0');
