INSERT INTO `%DB_PREFIX%deal_msg_list` VALUES ('4487','1385@fanwe.net','1','<div style=\"font-size:12px\"><div style=\"background-color: #FFFFFF; border:#dfe6ea solid 1px; padding: 5px 12px;\"><div style=\"width: 98%;text-align: right;\">编号：<span>20457</span></div>\r\n<h2 align=\"center\">借款协议</h2>\r\n<br/>\r\n<div style=\"text-align: left;font-weight: 600;\">甲方（出借人）：</div>\r\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\r\n    <tr>\r\n	<td style=\"text-align:center;\"> p2p信贷用户名</td>\r\n	<td style=\"text-align:center;\"> 借出金额</td>\r\n	<td style=\"text-align:center;\">借款期限</td>\r\n		<td style=\"text-align:center;\"> 每月应收本息</td>\r\n	    </tr>\r\n        <tr>\r\n	<td style=\"text-align:center;\">fanwe</td>\r\n	<td style=\"text-align:right;padding-right:10px\">￥5,000.00</td>\r\n	<td style=\"text-align:center;\">6个月</td>\r\n	<td style=\"text-align:right;padding-right:10px\">\r\n		￥870.17		</td>\r\n		</tr>\r\n        <tr>\r\n	<td style=\"text-align:center;\">yhz</td>\r\n	<td style=\"text-align:right;padding-right:10px\">￥5,000.00</td>\r\n	<td style=\"text-align:center;\">6个月</td>\r\n	<td style=\"text-align:right;padding-right:10px\">\r\n		￥870.17		</td>\r\n		</tr>\r\n        <tr>\r\n	<td style=\"text-align:center;\">总计</td>\r\n	<td style=\"text-align:right;padding-right:10px\">￥10,000.00</td>\r\n	<td>&nbsp;</td>\r\n	<td>&nbsp;</td>\r\n	    </tr>\r\n</table>\r\n<p>注：因计算中存在四舍五入，最后一期应收本息与之前略有不同</p>\r\n<br/>\r\n<div>\r\n	<p style=\"text-align: left;font-weight: 600;\">乙方（借款人）：</p>\r\n	<p style=\"text-align: left;font-weight: 600;\">p2p信贷用户名：<span>zj</span></p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\"> 丙方（见证人）：p2p信贷金融信息服务有限公司 </p>\r\n	<p style=\"text-align: left;font-weight: 600;\">联系方式：</p>\r\n</div>\r\n<br/>\r\n<p><strong>鉴于：</strong></p>\r\n<p>1、丙方是一家在合法成立并有效存续的有限责任公司，拥有t2.fanwe.net 网站（以下简称“该网站”）的经营权，提供信用咨询，为交易提供信息服务；</p>\r\n<p>2、乙方已在该网站注册，并承诺其提供给丙方的信息是完全真实的；</p>\r\n<p>3、甲方承诺对本协议涉及的借款具有完全的支配能力，是其自有闲散资金，为其合法所得；并承诺其提供给丙方的信息是完全真实的；</p>\r\n<p>4、乙方有借款需求，甲方亦同意借款，双方有意成立借贷关系；</p>\r\n<br/>\r\n<p style=\"text-align: left;font-weight: 600;\">各方经协商一致，于<span> 2015年02月11日</span>签订如下协议，共同遵照履行：</p>\r\n<br/>\r\n<p style=\"text-align: left;font-weight: 600;\"> 第一条 借款基本信息</p>\r\n<br/>\r\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\r\n	<tr>\r\n		<td width=\"20%\" style=\"padding-left:10px\"> 借款详细用途</td>\r\n		<td style=\"padding-left:10px\"> 医疗支出</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\"padding-left:10px\">借款本金数额</td>\r\n		<td style=\"padding-left:10px\">\r\n			￥10,000.00（各出借人借款本金数额详见本协议文首表格）\r\n		</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\"padding-left:10px\"> 月偿还本息数额		</td>\r\n		<td style=\"padding-left:10px\">\r\n			￥1,740.34（因计算中存在四舍五入，最后一期应还金额与之前可能有所不同，为￥1,740.33）		</td>\r\n	</tr>\r\n		<tr>\r\n		<td style=\"padding-left:10px\"> 还款分期月数\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			6    个月		</td>\r\n	</tr>\r\n		<tr>\r\n		<td style=\"padding-left:10px\">\r\n			还款日\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			 自2015年02月11日起，每月    2015年08月11日日（24:00前，节假日不顺延）\r\n		</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\"padding-left:10px\"> 借款期限\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			6个月，2015年02月11日起，至  2015年08月11日日止\r\n		</td>\r\n	</tr>\r\n</table>\r\n<br/>\r\n<div>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第二条 各方权利和义务\r\n	</p>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		<u>甲方的权利和义务</u>\r\n	</p>\r\n	<p> 1、	甲方应按合同约定的借款期限起始日期将足额的借款本金支付给乙方。\r\n	</p>\r\n	<p> 2、	甲方享有其所出借款项所带来的利息收益。\r\n	</p>\r\n	<p>3、	如乙方违约，甲方有权要求丙方提供其已获得的乙方信息，丙方应当提供。\r\n	</p>\r\n	<p>4、	无须通知乙方，甲方可以根据自己的意愿进行本协议下其对乙方债权的转让。在甲方的债权转让后，乙方需对债权受让人继续履行本协议下其对甲方的还款义务，不得以未接到债权转让通知为由拒绝履行还款义务。\r\n	</p>\r\n	<p> 5、	甲方应主动缴纳由利息所得带来的可能的税费。\r\n	</p>\r\n	<p>6、	如乙方实际还款金额少于本协议约定的本金、利息及违约金的，甲方各出借人同意各自按照其于本协议文首约定的借款比例收取还款。\r\n	</p>\r\n	<p> 7、	甲方应确保其提供信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\r\n	</p>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		<u>乙方权利和义务</u>\r\n	</p>\r\n	<p> 1、	乙方必须按期足额向甲方偿还本金和利息。\r\n	</p>\r\n	<p> 2、    乙方必须按期足额向丙方支付借款管理费用。\r\n	</p>\r\n	<p>3、	乙方承诺所借款项不用于任何违法用途。\r\n	</p>\r\n	<p>4、	乙方应确保其提供的信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\r\n	</p>\r\n	<p>5、	乙方有权了解其在丙方的信用评审进度及结果。\r\n	</p>\r\n	<p> 6、	乙方不得将本协议项下的任何权利义务转让给任何其他方。\r\n	</p>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		<u>丙方的权利和义务</u>\r\n	</p>\r\n	<p>1、甲方授权并委托丙方代其收取本协议文首所约定的出借人每月应收本息，代收后按照甲方的要求进行处置，乙方对此表示认可。\r\n	</p>\r\n	<p>2、甲方授权并委托丙方将其支付的出借本金直接划付至乙方账户，乙方对此表示认可。\r\n	</p>\r\n	<p> 3、甲、乙双方一致同意，在有必要时，丙方有权代甲方对乙方进行关于本协议借款的违约提醒及催收工作，包括但不限于：电话通知、上门催收提醒、发律师函、对乙方提起诉讼等。甲方在此确认委托丙方为其进行以上工作，并授权丙方可以将此工作委托给本协议外的其他方进行。乙方对前述委托的提醒、催收事项已明确知晓并应积极配合。\r\n	</p>\r\n	<p>4、丙方有权按月向乙方收取双方约定的借款管理费，并在有必要时对乙方进行违约提醒及催收工作，包括但不限于电话通知、发律师函、对乙方提起诉讼等。丙方有权将此违约提醒及催收工作委托给本协议外的其他方进行。\r\n	</p>\r\n	<p> 5、丙方接受甲乙双方的委托行为所产生的法律后果由相应委托方承担。如因乙方或甲方或其他方（包括但不限于技术问题）造成的延误或错误，丙方不承担任何责任。\r\n	</p>\r\n	<p> 6、丙方应对甲方和乙方的信息及本协议内容保密；如任何一方违约，或因相关权力部门要求（包括但不限于法院、仲裁机构、金融监管机构等），丙方有权披露。\r\n	</p>\r\n	<p>7、丙方根据本协议对乙方进行违约提醒及催收工作时，可在其认为必要时进行上门催收提醒，即丙方派出人员（至少2名）至乙方披露的住所地或经常居住地（联系地址）处催收和进行违约提醒，同时向乙方发送催收通知单，乙方应当签收，乙方不签收的，不影响上门催收提醒的进行。丙方采取上门催收提醒的，乙方应当向丙方支付上门提醒费用，收费标准为每次人民币1000.00元，此外，乙方还应向丙方支付进行上门催收提醒服务的差旅费（包括但不限于交通费、食宿费等）。\r\n	</p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第三条 借款管理费及居间服务费\r\n	</p>\r\n	<p>1、	在本协议中，“借款管理费”和“居间服务费”是指因丙方为乙方提供信用咨询、评估、还款提醒、账户管理、还款特殊情况沟通、本金保障等系列信用相关服务（统称“信用服务”）而由乙方支付给丙方的报酬。\r\n	</p>\r\n	<p>2、	对于丙方向乙方提供的一系列信用服务，乙方同意在借款成功时向丙方支付本协议第一条约定借款本金总额的5.0%(即人民币500.00元)作为居间服务费，该“居间服务费”由乙方授权并委托丙方在丙方根据本协议规定的“丙方的权利和义务”第2款规定向乙方划付出借本金时从本金中予以扣除，即视为乙方已缴纳。在本协议约定的借款期限内，乙方应每月向丙方支付本协议第一条约定借款本金总额的0% (即人民币0.00元)，作为借款管理费用，共需支付6期，共计人民币0.00 元，借款管理费的缴纳时间与本协议第一条约定的还款日一致。</p>\r\n	<p> 本条所称的“借款成功时”系指本协议签署日。</p>\r\n	<p> 3、    如乙方和丙方协商一致调整借款管理费和居间服务费时，无需经过甲方同意。 </p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第四条 违约责任\r\n	</p>\r\n	<p> 1、协议各方均应严格履行合同义务，非经各方协商一致或依照本协议约定，任何一方不得解除本协议。\r\n	</p>\r\n	<p>2、任何一方违约，违约方应承担因违约使得其他各方产生的费用和损失，包括但不限于调查、诉讼费、律师费等，应由违约方承担。如违约方为乙方的，甲方有权立即解除本协议，并要求乙方立即偿还未偿还的本金、利息、罚息、违约金。此时，乙方还应向丙方支付所有应付的借款管理费。如本协议提前解除时，乙方在t2.fanwe.net网站的账户里有任何余款的，丙方有权按照本协议第四条第3项的清偿顺序将乙方的余款用于清偿，并要求乙方支付因此产生的相关费用。</p>\r\n	<p>3、乙方的每期还款均应按照如下顺序清偿：</p>\r\n	<p>（1）根据本协议产生的其他全部费用；</p>\r\n	<p>（2）本协议第四条第4款约定的罚息； </p>\r\n	<p>（3）本协议第四条第5款约定的逾期管理费；</p>\r\n	<p>（4）拖欠的利息； </p>\r\n	<p>（5）拖欠的本金； </p>\r\n	<p>（6）拖欠丙方的借款管理费；\r\n	</p>\r\n	<p>（7）正常的利息； </p>\r\n	<p>（8）正常的本金； </p>\r\n	<p>（9）丙方的借款管理费；</p>\r\n	<p> 4、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向甲方支付逾期罚息，自逾期开始之后，逾期本金的正常利息停止计算。 </p>\r\n	<p>罚息总额 = 逾期本息总额×对应罚息利率×逾期天数；</p>\r\n</div>\r\n<div>\r\n	<br/>\r\n	<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\r\n		<tr>\r\n			<td style=\"padding-left:10px\">\r\n				逾期天数\r\n			</td>\r\n			<td style=\"padding-left:10px\">\r\n				1—30天\r\n			</td>\r\n			<td style=\"padding-left:10px\">\r\n				31天及以上\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"padding-left:10px\">\r\n				罚息利率\r\n			</td>\r\n			<td style=\"padding-left:10px\">\r\n				0.05%\r\n			</td>\r\n			<td style=\"padding-left:10px\">\r\n				0.1%\r\n			</td>\r\n		</tr>\r\n	</table>\r\n	<br/>\r\n	<p>\r\n		5、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向丙方支付逾期管理费：\r\n	</p>\r\n	<p>\r\n		逾期管理费总额 = 逾期本息总额×对应逾期管理费率×逾期天数；\r\n	</p>\r\n</div>\r\n<br/>\r\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\r\n	<tr>\r\n		<td style=\"padding-left:10px\">\r\n			逾期天数\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			1—30天\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			31天及以上\r\n		</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\"padding-left:10px\">\r\n			逾期管理费费率\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			0.1%\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			0.5%\r\n		</td>\r\n	</tr>\r\n</table>\r\n<br/>\r\n<div>\r\n	<p>\r\n		6、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，本协议项下的全部借款本息及借款管理费均提前到期，乙方应立即清偿本协议下尚未偿付的全部本金、利息、罚息、借款管理费及根据本协议产生的其他全部费用。\r\n	</p>\r\n	<p>\r\n		7、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方的“逾期记录”记入人民银行公民征信系统，丙方不承担任何法律责任。\r\n	</p>\r\n	<p>\r\n		8、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方违约失信的相关信息及乙方其他信息向媒体、用人单位、公安机关、检查机关、法律机关披露，丙方不承担任何责任。\r\n	</p>\r\n	<p>\r\n		9、在乙方还清全部本金、利息、借款管理费、罚息、逾期管理费之前，罚息及逾期管理费的计算不停止。\r\n	</p>\r\n	<p>\r\n		10、本协议中的所有甲方与乙方之间的借款均是相互独立的，一旦乙方逾期未归还借款本息，甲方中的任何一个出借人均有权单独向乙方追索或者提起诉讼。如乙方逾期支付借款管理费或提供虚假信息的，丙方亦可单独向乙方追索或者提起诉讼。\r\n	</p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第五条 提前还款\r\n	</p>\r\n	<p>\r\n		1、乙方可在借款期间任何时候提前偿还剩余借款。\r\n	</p>\r\n	<p>\r\n		2、提前偿还全部剩余借款\r\n	</p>\r\n	<p style=\"padding-left: 15px\">\r\n		1）乙方提前清偿全部剩余借款时，应向甲方支付当期应还本息，剩余本金及提前还款补偿（补偿金额为剩余本金的0%）。\r\n	</p>\r\n	<p style=\"padding-left: 15px\">\r\n		2）乙方提前清偿全部剩余借款时，应向丙方支付当期借款管理费，乙方无需支付剩余还款期的借款管理费。\r\n	</p>\r\n	<p>\r\n		3、提前偿还部分借款\r\n	</p>\r\n	<p style=\"padding-left: 15px\">\r\n		1）乙方提前偿还部分借款，仍应向甲方支付全部借款利息。\r\n	</p>\r\n	<p style=\"padding-left: 15px\">\r\n		2）乙方提前偿还部分借款，仍应向丙方支付全部应付的借款管理费。\r\n	</p>\r\n	<p>\r\n		4、任何形式的提前还款不影响丙方向乙方收取在本协议第三条中说明的居间服务费。\r\n	</p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第六条	法律及争议解决\r\n	</p>\r\n	 <p>\r\n		 本协议的签订、履行、终止、解释均适用中华人民共和国法律，并由丙方所在地人民法院管辖。\r\n	</p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第七条	附则\r\n	</p>\r\n	<p>\r\n		1、本协议采用电子文本形式制成，并永久保存在丙方为此设立的专用服务器上备查，各方均认可该形式的协议效力。\r\n	</p>\r\n	<p>\r\n		2、本协议自文本最终生成之日生效。\r\n	</p>\r\n	<p>\r\n		3、本协议签订之日起至借款全部清偿之日止，乙方或甲方有义务在下列信息变更三日内提供更新后的信息给丙方：本人、本人的家庭联系人及紧急联系人、工作单位、居住地址、住所电话、手机号码、电子邮箱、银行账户的变更。若因任何一方不及时提供上述变更信息而带来的损失或额外费用应由该方承担。\r\n	</p>\r\n	<p>\r\n		4、如果本协议中的任何一条或多条违反适用的法律法规，则该条将被视为无效，但该无效条款并不影响本协议其他条款的效力。\r\n	</p>\r\n</div>\r\n<br/>\r\n<div style=\"width: 98%;text-align: right;\">\r\n	<p>\r\n		2015年02月11日	</p>\r\n</div></div></div>','1423622175','1','1423622172','1385','','1','1','借款“贷款测试zj11”的电子协议！','0','0');
INSERT INTO `%DB_PREFIX%deal_msg_list` VALUES ('4488','fanwe@fanwe.net','1','<div style=\"font-size:12px\"><div style=\"background-color: #FFFFFF; border:#dfe6ea solid 1px; padding: 5px 12px;\"><div style=\"width: 98%;text-align: right;\">编号：<span>20457</span></div>\r\n<h2 align=\"center\">借款协议</h2>\r\n<br/>\r\n<div style=\"text-align: left;font-weight: 600;\">甲方（出借人）：</div>\r\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\r\n    <tr>\r\n	<td style=\"text-align:center;\"> p2p信贷用户名</td>\r\n	<td style=\"text-align:center;\"> 借出金额</td>\r\n	<td style=\"text-align:center;\">借款期限</td>\r\n		<td style=\"text-align:center;\"> 每月应收本息</td>\r\n	    </tr>\r\n        <tr>\r\n	<td style=\"text-align:center;\">fanwe</td>\r\n	<td style=\"text-align:right;padding-right:10px\">￥5,000.00</td>\r\n	<td style=\"text-align:center;\">6个月</td>\r\n	<td style=\"text-align:right;padding-right:10px\">\r\n		￥870.17		</td>\r\n		</tr>\r\n        <tr>\r\n	<td style=\"text-align:center;\">yhz</td>\r\n	<td style=\"text-align:right;padding-right:10px\">￥5,000.00</td>\r\n	<td style=\"text-align:center;\">6个月</td>\r\n	<td style=\"text-align:right;padding-right:10px\">\r\n		￥870.17		</td>\r\n		</tr>\r\n        <tr>\r\n	<td style=\"text-align:center;\">总计</td>\r\n	<td style=\"text-align:right;padding-right:10px\">￥10,000.00</td>\r\n	<td>&nbsp;</td>\r\n	<td>&nbsp;</td>\r\n	    </tr>\r\n</table>\r\n<p>注：因计算中存在四舍五入，最后一期应收本息与之前略有不同</p>\r\n<br/>\r\n<div>\r\n	<p style=\"text-align: left;font-weight: 600;\">乙方（借款人）：</p>\r\n	<p style=\"text-align: left;font-weight: 600;\">p2p信贷用户名：<span>zj</span></p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\"> 丙方（见证人）：p2p信贷金融信息服务有限公司 </p>\r\n	<p style=\"text-align: left;font-weight: 600;\">联系方式：</p>\r\n</div>\r\n<br/>\r\n<p><strong>鉴于：</strong></p>\r\n<p>1、丙方是一家在合法成立并有效存续的有限责任公司，拥有t2.fanwe.net 网站（以下简称“该网站”）的经营权，提供信用咨询，为交易提供信息服务；</p>\r\n<p>2、乙方已在该网站注册，并承诺其提供给丙方的信息是完全真实的；</p>\r\n<p>3、甲方承诺对本协议涉及的借款具有完全的支配能力，是其自有闲散资金，为其合法所得；并承诺其提供给丙方的信息是完全真实的；</p>\r\n<p>4、乙方有借款需求，甲方亦同意借款，双方有意成立借贷关系；</p>\r\n<br/>\r\n<p style=\"text-align: left;font-weight: 600;\">各方经协商一致，于<span> 2015年02月11日</span>签订如下协议，共同遵照履行：</p>\r\n<br/>\r\n<p style=\"text-align: left;font-weight: 600;\"> 第一条 借款基本信息</p>\r\n<br/>\r\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\r\n	<tr>\r\n		<td width=\"20%\" style=\"padding-left:10px\"> 借款详细用途</td>\r\n		<td style=\"padding-left:10px\"> 医疗支出</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\"padding-left:10px\">借款本金数额</td>\r\n		<td style=\"padding-left:10px\">\r\n			￥10,000.00（各出借人借款本金数额详见本协议文首表格）\r\n		</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\"padding-left:10px\"> 月偿还本息数额		</td>\r\n		<td style=\"padding-left:10px\">\r\n			￥1,740.34（因计算中存在四舍五入，最后一期应还金额与之前可能有所不同，为￥1,740.33）		</td>\r\n	</tr>\r\n		<tr>\r\n		<td style=\"padding-left:10px\"> 还款分期月数\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			6    个月		</td>\r\n	</tr>\r\n		<tr>\r\n		<td style=\"padding-left:10px\">\r\n			还款日\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			 自2015年02月11日起，每月    2015年08月11日日（24:00前，节假日不顺延）\r\n		</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\"padding-left:10px\"> 借款期限\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			6个月，2015年02月11日起，至  2015年08月11日日止\r\n		</td>\r\n	</tr>\r\n</table>\r\n<br/>\r\n<div>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第二条 各方权利和义务\r\n	</p>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		<u>甲方的权利和义务</u>\r\n	</p>\r\n	<p> 1、	甲方应按合同约定的借款期限起始日期将足额的借款本金支付给乙方。\r\n	</p>\r\n	<p> 2、	甲方享有其所出借款项所带来的利息收益。\r\n	</p>\r\n	<p>3、	如乙方违约，甲方有权要求丙方提供其已获得的乙方信息，丙方应当提供。\r\n	</p>\r\n	<p>4、	无须通知乙方，甲方可以根据自己的意愿进行本协议下其对乙方债权的转让。在甲方的债权转让后，乙方需对债权受让人继续履行本协议下其对甲方的还款义务，不得以未接到债权转让通知为由拒绝履行还款义务。\r\n	</p>\r\n	<p> 5、	甲方应主动缴纳由利息所得带来的可能的税费。\r\n	</p>\r\n	<p>6、	如乙方实际还款金额少于本协议约定的本金、利息及违约金的，甲方各出借人同意各自按照其于本协议文首约定的借款比例收取还款。\r\n	</p>\r\n	<p> 7、	甲方应确保其提供信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\r\n	</p>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		<u>乙方权利和义务</u>\r\n	</p>\r\n	<p> 1、	乙方必须按期足额向甲方偿还本金和利息。\r\n	</p>\r\n	<p> 2、    乙方必须按期足额向丙方支付借款管理费用。\r\n	</p>\r\n	<p>3、	乙方承诺所借款项不用于任何违法用途。\r\n	</p>\r\n	<p>4、	乙方应确保其提供的信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\r\n	</p>\r\n	<p>5、	乙方有权了解其在丙方的信用评审进度及结果。\r\n	</p>\r\n	<p> 6、	乙方不得将本协议项下的任何权利义务转让给任何其他方。\r\n	</p>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		<u>丙方的权利和义务</u>\r\n	</p>\r\n	<p>1、甲方授权并委托丙方代其收取本协议文首所约定的出借人每月应收本息，代收后按照甲方的要求进行处置，乙方对此表示认可。\r\n	</p>\r\n	<p>2、甲方授权并委托丙方将其支付的出借本金直接划付至乙方账户，乙方对此表示认可。\r\n	</p>\r\n	<p> 3、甲、乙双方一致同意，在有必要时，丙方有权代甲方对乙方进行关于本协议借款的违约提醒及催收工作，包括但不限于：电话通知、上门催收提醒、发律师函、对乙方提起诉讼等。甲方在此确认委托丙方为其进行以上工作，并授权丙方可以将此工作委托给本协议外的其他方进行。乙方对前述委托的提醒、催收事项已明确知晓并应积极配合。\r\n	</p>\r\n	<p>4、丙方有权按月向乙方收取双方约定的借款管理费，并在有必要时对乙方进行违约提醒及催收工作，包括但不限于电话通知、发律师函、对乙方提起诉讼等。丙方有权将此违约提醒及催收工作委托给本协议外的其他方进行。\r\n	</p>\r\n	<p> 5、丙方接受甲乙双方的委托行为所产生的法律后果由相应委托方承担。如因乙方或甲方或其他方（包括但不限于技术问题）造成的延误或错误，丙方不承担任何责任。\r\n	</p>\r\n	<p> 6、丙方应对甲方和乙方的信息及本协议内容保密；如任何一方违约，或因相关权力部门要求（包括但不限于法院、仲裁机构、金融监管机构等），丙方有权披露。\r\n	</p>\r\n	<p>7、丙方根据本协议对乙方进行违约提醒及催收工作时，可在其认为必要时进行上门催收提醒，即丙方派出人员（至少2名）至乙方披露的住所地或经常居住地（联系地址）处催收和进行违约提醒，同时向乙方发送催收通知单，乙方应当签收，乙方不签收的，不影响上门催收提醒的进行。丙方采取上门催收提醒的，乙方应当向丙方支付上门提醒费用，收费标准为每次人民币1000.00元，此外，乙方还应向丙方支付进行上门催收提醒服务的差旅费（包括但不限于交通费、食宿费等）。\r\n	</p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第三条 借款管理费及居间服务费\r\n	</p>\r\n	<p>1、	在本协议中，“借款管理费”和“居间服务费”是指因丙方为乙方提供信用咨询、评估、还款提醒、账户管理、还款特殊情况沟通、本金保障等系列信用相关服务（统称“信用服务”）而由乙方支付给丙方的报酬。\r\n	</p>\r\n	<p>2、	对于丙方向乙方提供的一系列信用服务，乙方同意在借款成功时向丙方支付本协议第一条约定借款本金总额的5.0%(即人民币500.00元)作为居间服务费，该“居间服务费”由乙方授权并委托丙方在丙方根据本协议规定的“丙方的权利和义务”第2款规定向乙方划付出借本金时从本金中予以扣除，即视为乙方已缴纳。在本协议约定的借款期限内，乙方应每月向丙方支付本协议第一条约定借款本金总额的0% (即人民币0.00元)，作为借款管理费用，共需支付6期，共计人民币0.00 元，借款管理费的缴纳时间与本协议第一条约定的还款日一致。</p>\r\n	<p> 本条所称的“借款成功时”系指本协议签署日。</p>\r\n	<p> 3、    如乙方和丙方协商一致调整借款管理费和居间服务费时，无需经过甲方同意。 </p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第四条 违约责任\r\n	</p>\r\n	<p> 1、协议各方均应严格履行合同义务，非经各方协商一致或依照本协议约定，任何一方不得解除本协议。\r\n	</p>\r\n	<p>2、任何一方违约，违约方应承担因违约使得其他各方产生的费用和损失，包括但不限于调查、诉讼费、律师费等，应由违约方承担。如违约方为乙方的，甲方有权立即解除本协议，并要求乙方立即偿还未偿还的本金、利息、罚息、违约金。此时，乙方还应向丙方支付所有应付的借款管理费。如本协议提前解除时，乙方在t2.fanwe.net网站的账户里有任何余款的，丙方有权按照本协议第四条第3项的清偿顺序将乙方的余款用于清偿，并要求乙方支付因此产生的相关费用。</p>\r\n	<p>3、乙方的每期还款均应按照如下顺序清偿：</p>\r\n	<p>（1）根据本协议产生的其他全部费用；</p>\r\n	<p>（2）本协议第四条第4款约定的罚息； </p>\r\n	<p>（3）本协议第四条第5款约定的逾期管理费；</p>\r\n	<p>（4）拖欠的利息； </p>\r\n	<p>（5）拖欠的本金； </p>\r\n	<p>（6）拖欠丙方的借款管理费；\r\n	</p>\r\n	<p>（7）正常的利息； </p>\r\n	<p>（8）正常的本金； </p>\r\n	<p>（9）丙方的借款管理费；</p>\r\n	<p> 4、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向甲方支付逾期罚息，自逾期开始之后，逾期本金的正常利息停止计算。 </p>\r\n	<p>罚息总额 = 逾期本息总额×对应罚息利率×逾期天数；</p>\r\n</div>\r\n<div>\r\n	<br/>\r\n	<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\r\n		<tr>\r\n			<td style=\"padding-left:10px\">\r\n				逾期天数\r\n			</td>\r\n			<td style=\"padding-left:10px\">\r\n				1—30天\r\n			</td>\r\n			<td style=\"padding-left:10px\">\r\n				31天及以上\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"padding-left:10px\">\r\n				罚息利率\r\n			</td>\r\n			<td style=\"padding-left:10px\">\r\n				0.05%\r\n			</td>\r\n			<td style=\"padding-left:10px\">\r\n				0.1%\r\n			</td>\r\n		</tr>\r\n	</table>\r\n	<br/>\r\n	<p>\r\n		5、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向丙方支付逾期管理费：\r\n	</p>\r\n	<p>\r\n		逾期管理费总额 = 逾期本息总额×对应逾期管理费率×逾期天数；\r\n	</p>\r\n</div>\r\n<br/>\r\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\r\n	<tr>\r\n		<td style=\"padding-left:10px\">\r\n			逾期天数\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			1—30天\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			31天及以上\r\n		</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\"padding-left:10px\">\r\n			逾期管理费费率\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			0.1%\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			0.5%\r\n		</td>\r\n	</tr>\r\n</table>\r\n<br/>\r\n<div>\r\n	<p>\r\n		6、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，本协议项下的全部借款本息及借款管理费均提前到期，乙方应立即清偿本协议下尚未偿付的全部本金、利息、罚息、借款管理费及根据本协议产生的其他全部费用。\r\n	</p>\r\n	<p>\r\n		7、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方的“逾期记录”记入人民银行公民征信系统，丙方不承担任何法律责任。\r\n	</p>\r\n	<p>\r\n		8、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方违约失信的相关信息及乙方其他信息向媒体、用人单位、公安机关、检查机关、法律机关披露，丙方不承担任何责任。\r\n	</p>\r\n	<p>\r\n		9、在乙方还清全部本金、利息、借款管理费、罚息、逾期管理费之前，罚息及逾期管理费的计算不停止。\r\n	</p>\r\n	<p>\r\n		10、本协议中的所有甲方与乙方之间的借款均是相互独立的，一旦乙方逾期未归还借款本息，甲方中的任何一个出借人均有权单独向乙方追索或者提起诉讼。如乙方逾期支付借款管理费或提供虚假信息的，丙方亦可单独向乙方追索或者提起诉讼。\r\n	</p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第五条 提前还款\r\n	</p>\r\n	<p>\r\n		1、乙方可在借款期间任何时候提前偿还剩余借款。\r\n	</p>\r\n	<p>\r\n		2、提前偿还全部剩余借款\r\n	</p>\r\n	<p style=\"padding-left: 15px\">\r\n		1）乙方提前清偿全部剩余借款时，应向甲方支付当期应还本息，剩余本金及提前还款补偿（补偿金额为剩余本金的0%）。\r\n	</p>\r\n	<p style=\"padding-left: 15px\">\r\n		2）乙方提前清偿全部剩余借款时，应向丙方支付当期借款管理费，乙方无需支付剩余还款期的借款管理费。\r\n	</p>\r\n	<p>\r\n		3、提前偿还部分借款\r\n	</p>\r\n	<p style=\"padding-left: 15px\">\r\n		1）乙方提前偿还部分借款，仍应向甲方支付全部借款利息。\r\n	</p>\r\n	<p style=\"padding-left: 15px\">\r\n		2）乙方提前偿还部分借款，仍应向丙方支付全部应付的借款管理费。\r\n	</p>\r\n	<p>\r\n		4、任何形式的提前还款不影响丙方向乙方收取在本协议第三条中说明的居间服务费。\r\n	</p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第六条	法律及争议解决\r\n	</p>\r\n	 <p>\r\n		 本协议的签订、履行、终止、解释均适用中华人民共和国法律，并由丙方所在地人民法院管辖。\r\n	</p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第七条	附则\r\n	</p>\r\n	<p>\r\n		1、本协议采用电子文本形式制成，并永久保存在丙方为此设立的专用服务器上备查，各方均认可该形式的协议效力。\r\n	</p>\r\n	<p>\r\n		2、本协议自文本最终生成之日生效。\r\n	</p>\r\n	<p>\r\n		3、本协议签订之日起至借款全部清偿之日止，乙方或甲方有义务在下列信息变更三日内提供更新后的信息给丙方：本人、本人的家庭联系人及紧急联系人、工作单位、居住地址、住所电话、手机号码、电子邮箱、银行账户的变更。若因任何一方不及时提供上述变更信息而带来的损失或额外费用应由该方承担。\r\n	</p>\r\n	<p>\r\n		4、如果本协议中的任何一条或多条违反适用的法律法规，则该条将被视为无效，但该无效条款并不影响本协议其他条款的效力。\r\n	</p>\r\n</div>\r\n<br/>\r\n<div style=\"width: 98%;text-align: right;\">\r\n	<p>\r\n		2015年02月11日	</p>\r\n</div></div></div>','1423622177','1','1423622172','44','','1','1','借款“贷款测试zj11”的电子协议！','0','0');
INSERT INTO `%DB_PREFIX%deal_msg_list` VALUES ('4489','1404@fanwe.net','1','<div style=\"font-size:12px\"><div style=\"background-color: #FFFFFF; border:#dfe6ea solid 1px; padding: 5px 12px;\"><div style=\"width: 98%;text-align: right;\">编号：<span>20457</span></div>\r\n<h2 align=\"center\">借款协议</h2>\r\n<br/>\r\n<div style=\"text-align: left;font-weight: 600;\">甲方（出借人）：</div>\r\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\r\n    <tr>\r\n	<td style=\"text-align:center;\"> p2p信贷用户名</td>\r\n	<td style=\"text-align:center;\"> 借出金额</td>\r\n	<td style=\"text-align:center;\">借款期限</td>\r\n		<td style=\"text-align:center;\"> 每月应收本息</td>\r\n	    </tr>\r\n        <tr>\r\n	<td style=\"text-align:center;\">fanwe</td>\r\n	<td style=\"text-align:right;padding-right:10px\">￥5,000.00</td>\r\n	<td style=\"text-align:center;\">6个月</td>\r\n	<td style=\"text-align:right;padding-right:10px\">\r\n		￥870.17		</td>\r\n		</tr>\r\n        <tr>\r\n	<td style=\"text-align:center;\">yhz</td>\r\n	<td style=\"text-align:right;padding-right:10px\">￥5,000.00</td>\r\n	<td style=\"text-align:center;\">6个月</td>\r\n	<td style=\"text-align:right;padding-right:10px\">\r\n		￥870.17		</td>\r\n		</tr>\r\n        <tr>\r\n	<td style=\"text-align:center;\">总计</td>\r\n	<td style=\"text-align:right;padding-right:10px\">￥10,000.00</td>\r\n	<td>&nbsp;</td>\r\n	<td>&nbsp;</td>\r\n	    </tr>\r\n</table>\r\n<p>注：因计算中存在四舍五入，最后一期应收本息与之前略有不同</p>\r\n<br/>\r\n<div>\r\n	<p style=\"text-align: left;font-weight: 600;\">乙方（借款人）：</p>\r\n	<p style=\"text-align: left;font-weight: 600;\">p2p信贷用户名：<span>zj</span></p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\"> 丙方（见证人）：p2p信贷金融信息服务有限公司 </p>\r\n	<p style=\"text-align: left;font-weight: 600;\">联系方式：</p>\r\n</div>\r\n<br/>\r\n<p><strong>鉴于：</strong></p>\r\n<p>1、丙方是一家在合法成立并有效存续的有限责任公司，拥有t2.fanwe.net 网站（以下简称“该网站”）的经营权，提供信用咨询，为交易提供信息服务；</p>\r\n<p>2、乙方已在该网站注册，并承诺其提供给丙方的信息是完全真实的；</p>\r\n<p>3、甲方承诺对本协议涉及的借款具有完全的支配能力，是其自有闲散资金，为其合法所得；并承诺其提供给丙方的信息是完全真实的；</p>\r\n<p>4、乙方有借款需求，甲方亦同意借款，双方有意成立借贷关系；</p>\r\n<br/>\r\n<p style=\"text-align: left;font-weight: 600;\">各方经协商一致，于<span> 2015年02月11日</span>签订如下协议，共同遵照履行：</p>\r\n<br/>\r\n<p style=\"text-align: left;font-weight: 600;\"> 第一条 借款基本信息</p>\r\n<br/>\r\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\r\n	<tr>\r\n		<td width=\"20%\" style=\"padding-left:10px\"> 借款详细用途</td>\r\n		<td style=\"padding-left:10px\"> 医疗支出</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\"padding-left:10px\">借款本金数额</td>\r\n		<td style=\"padding-left:10px\">\r\n			￥10,000.00（各出借人借款本金数额详见本协议文首表格）\r\n		</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\"padding-left:10px\"> 月偿还本息数额		</td>\r\n		<td style=\"padding-left:10px\">\r\n			￥1,740.34（因计算中存在四舍五入，最后一期应还金额与之前可能有所不同，为￥1,740.33）		</td>\r\n	</tr>\r\n		<tr>\r\n		<td style=\"padding-left:10px\"> 还款分期月数\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			6    个月		</td>\r\n	</tr>\r\n		<tr>\r\n		<td style=\"padding-left:10px\">\r\n			还款日\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			 自2015年02月11日起，每月    2015年08月11日日（24:00前，节假日不顺延）\r\n		</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\"padding-left:10px\"> 借款期限\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			6个月，2015年02月11日起，至  2015年08月11日日止\r\n		</td>\r\n	</tr>\r\n</table>\r\n<br/>\r\n<div>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第二条 各方权利和义务\r\n	</p>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		<u>甲方的权利和义务</u>\r\n	</p>\r\n	<p> 1、	甲方应按合同约定的借款期限起始日期将足额的借款本金支付给乙方。\r\n	</p>\r\n	<p> 2、	甲方享有其所出借款项所带来的利息收益。\r\n	</p>\r\n	<p>3、	如乙方违约，甲方有权要求丙方提供其已获得的乙方信息，丙方应当提供。\r\n	</p>\r\n	<p>4、	无须通知乙方，甲方可以根据自己的意愿进行本协议下其对乙方债权的转让。在甲方的债权转让后，乙方需对债权受让人继续履行本协议下其对甲方的还款义务，不得以未接到债权转让通知为由拒绝履行还款义务。\r\n	</p>\r\n	<p> 5、	甲方应主动缴纳由利息所得带来的可能的税费。\r\n	</p>\r\n	<p>6、	如乙方实际还款金额少于本协议约定的本金、利息及违约金的，甲方各出借人同意各自按照其于本协议文首约定的借款比例收取还款。\r\n	</p>\r\n	<p> 7、	甲方应确保其提供信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\r\n	</p>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		<u>乙方权利和义务</u>\r\n	</p>\r\n	<p> 1、	乙方必须按期足额向甲方偿还本金和利息。\r\n	</p>\r\n	<p> 2、    乙方必须按期足额向丙方支付借款管理费用。\r\n	</p>\r\n	<p>3、	乙方承诺所借款项不用于任何违法用途。\r\n	</p>\r\n	<p>4、	乙方应确保其提供的信息和资料的真实性，不得提供虚假信息或隐瞒重要事实。\r\n	</p>\r\n	<p>5、	乙方有权了解其在丙方的信用评审进度及结果。\r\n	</p>\r\n	<p> 6、	乙方不得将本协议项下的任何权利义务转让给任何其他方。\r\n	</p>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		<u>丙方的权利和义务</u>\r\n	</p>\r\n	<p>1、甲方授权并委托丙方代其收取本协议文首所约定的出借人每月应收本息，代收后按照甲方的要求进行处置，乙方对此表示认可。\r\n	</p>\r\n	<p>2、甲方授权并委托丙方将其支付的出借本金直接划付至乙方账户，乙方对此表示认可。\r\n	</p>\r\n	<p> 3、甲、乙双方一致同意，在有必要时，丙方有权代甲方对乙方进行关于本协议借款的违约提醒及催收工作，包括但不限于：电话通知、上门催收提醒、发律师函、对乙方提起诉讼等。甲方在此确认委托丙方为其进行以上工作，并授权丙方可以将此工作委托给本协议外的其他方进行。乙方对前述委托的提醒、催收事项已明确知晓并应积极配合。\r\n	</p>\r\n	<p>4、丙方有权按月向乙方收取双方约定的借款管理费，并在有必要时对乙方进行违约提醒及催收工作，包括但不限于电话通知、发律师函、对乙方提起诉讼等。丙方有权将此违约提醒及催收工作委托给本协议外的其他方进行。\r\n	</p>\r\n	<p> 5、丙方接受甲乙双方的委托行为所产生的法律后果由相应委托方承担。如因乙方或甲方或其他方（包括但不限于技术问题）造成的延误或错误，丙方不承担任何责任。\r\n	</p>\r\n	<p> 6、丙方应对甲方和乙方的信息及本协议内容保密；如任何一方违约，或因相关权力部门要求（包括但不限于法院、仲裁机构、金融监管机构等），丙方有权披露。\r\n	</p>\r\n	<p>7、丙方根据本协议对乙方进行违约提醒及催收工作时，可在其认为必要时进行上门催收提醒，即丙方派出人员（至少2名）至乙方披露的住所地或经常居住地（联系地址）处催收和进行违约提醒，同时向乙方发送催收通知单，乙方应当签收，乙方不签收的，不影响上门催收提醒的进行。丙方采取上门催收提醒的，乙方应当向丙方支付上门提醒费用，收费标准为每次人民币1000.00元，此外，乙方还应向丙方支付进行上门催收提醒服务的差旅费（包括但不限于交通费、食宿费等）。\r\n	</p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第三条 借款管理费及居间服务费\r\n	</p>\r\n	<p>1、	在本协议中，“借款管理费”和“居间服务费”是指因丙方为乙方提供信用咨询、评估、还款提醒、账户管理、还款特殊情况沟通、本金保障等系列信用相关服务（统称“信用服务”）而由乙方支付给丙方的报酬。\r\n	</p>\r\n	<p>2、	对于丙方向乙方提供的一系列信用服务，乙方同意在借款成功时向丙方支付本协议第一条约定借款本金总额的5.0%(即人民币500.00元)作为居间服务费，该“居间服务费”由乙方授权并委托丙方在丙方根据本协议规定的“丙方的权利和义务”第2款规定向乙方划付出借本金时从本金中予以扣除，即视为乙方已缴纳。在本协议约定的借款期限内，乙方应每月向丙方支付本协议第一条约定借款本金总额的0% (即人民币0.00元)，作为借款管理费用，共需支付6期，共计人民币0.00 元，借款管理费的缴纳时间与本协议第一条约定的还款日一致。</p>\r\n	<p> 本条所称的“借款成功时”系指本协议签署日。</p>\r\n	<p> 3、    如乙方和丙方协商一致调整借款管理费和居间服务费时，无需经过甲方同意。 </p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第四条 违约责任\r\n	</p>\r\n	<p> 1、协议各方均应严格履行合同义务，非经各方协商一致或依照本协议约定，任何一方不得解除本协议。\r\n	</p>\r\n	<p>2、任何一方违约，违约方应承担因违约使得其他各方产生的费用和损失，包括但不限于调查、诉讼费、律师费等，应由违约方承担。如违约方为乙方的，甲方有权立即解除本协议，并要求乙方立即偿还未偿还的本金、利息、罚息、违约金。此时，乙方还应向丙方支付所有应付的借款管理费。如本协议提前解除时，乙方在t2.fanwe.net网站的账户里有任何余款的，丙方有权按照本协议第四条第3项的清偿顺序将乙方的余款用于清偿，并要求乙方支付因此产生的相关费用。</p>\r\n	<p>3、乙方的每期还款均应按照如下顺序清偿：</p>\r\n	<p>（1）根据本协议产生的其他全部费用；</p>\r\n	<p>（2）本协议第四条第4款约定的罚息； </p>\r\n	<p>（3）本协议第四条第5款约定的逾期管理费；</p>\r\n	<p>（4）拖欠的利息； </p>\r\n	<p>（5）拖欠的本金； </p>\r\n	<p>（6）拖欠丙方的借款管理费；\r\n	</p>\r\n	<p>（7）正常的利息； </p>\r\n	<p>（8）正常的本金； </p>\r\n	<p>（9）丙方的借款管理费；</p>\r\n	<p> 4、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向甲方支付逾期罚息，自逾期开始之后，逾期本金的正常利息停止计算。 </p>\r\n	<p>罚息总额 = 逾期本息总额×对应罚息利率×逾期天数；</p>\r\n</div>\r\n<div>\r\n	<br/>\r\n	<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\r\n		<tr>\r\n			<td style=\"padding-left:10px\">\r\n				逾期天数\r\n			</td>\r\n			<td style=\"padding-left:10px\">\r\n				1—30天\r\n			</td>\r\n			<td style=\"padding-left:10px\">\r\n				31天及以上\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"padding-left:10px\">\r\n				罚息利率\r\n			</td>\r\n			<td style=\"padding-left:10px\">\r\n				0.05%\r\n			</td>\r\n			<td style=\"padding-left:10px\">\r\n				0.1%\r\n			</td>\r\n		</tr>\r\n	</table>\r\n	<br/>\r\n	<p>\r\n		5、乙方应严格履行还款义务，如乙方逾期还款，则应按照下述条款向丙方支付逾期管理费：\r\n	</p>\r\n	<p>\r\n		逾期管理费总额 = 逾期本息总额×对应逾期管理费率×逾期天数；\r\n	</p>\r\n</div>\r\n<br/>\r\n<table border=\"1\" style=\"margin: 0px auto; border-collapse: collapse; border: 1px solid rgb(0, 0, 0); width: 70%; \">\r\n	<tr>\r\n		<td style=\"padding-left:10px\">\r\n			逾期天数\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			1—30天\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			31天及以上\r\n		</td>\r\n	</tr>\r\n	<tr>\r\n		<td style=\"padding-left:10px\">\r\n			逾期管理费费率\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			0.1%\r\n		</td>\r\n		<td style=\"padding-left:10px\">\r\n			0.5%\r\n		</td>\r\n	</tr>\r\n</table>\r\n<br/>\r\n<div>\r\n	<p>\r\n		6、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，本协议项下的全部借款本息及借款管理费均提前到期，乙方应立即清偿本协议下尚未偿付的全部本金、利息、罚息、借款管理费及根据本协议产生的其他全部费用。\r\n	</p>\r\n	<p>\r\n		7、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方的“逾期记录”记入人民银行公民征信系统，丙方不承担任何法律责任。\r\n	</p>\r\n	<p>\r\n		8、如果乙方逾期支付任何一期还款超过30天，或乙方在逾期后出现逃避、拒绝沟通或拒绝承认欠款事实等恶意行为，丙方有权将乙方违约失信的相关信息及乙方其他信息向媒体、用人单位、公安机关、检查机关、法律机关披露，丙方不承担任何责任。\r\n	</p>\r\n	<p>\r\n		9、在乙方还清全部本金、利息、借款管理费、罚息、逾期管理费之前，罚息及逾期管理费的计算不停止。\r\n	</p>\r\n	<p>\r\n		10、本协议中的所有甲方与乙方之间的借款均是相互独立的，一旦乙方逾期未归还借款本息，甲方中的任何一个出借人均有权单独向乙方追索或者提起诉讼。如乙方逾期支付借款管理费或提供虚假信息的，丙方亦可单独向乙方追索或者提起诉讼。\r\n	</p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第五条 提前还款\r\n	</p>\r\n	<p>\r\n		1、乙方可在借款期间任何时候提前偿还剩余借款。\r\n	</p>\r\n	<p>\r\n		2、提前偿还全部剩余借款\r\n	</p>\r\n	<p style=\"padding-left: 15px\">\r\n		1）乙方提前清偿全部剩余借款时，应向甲方支付当期应还本息，剩余本金及提前还款补偿（补偿金额为剩余本金的0%）。\r\n	</p>\r\n	<p style=\"padding-left: 15px\">\r\n		2）乙方提前清偿全部剩余借款时，应向丙方支付当期借款管理费，乙方无需支付剩余还款期的借款管理费。\r\n	</p>\r\n	<p>\r\n		3、提前偿还部分借款\r\n	</p>\r\n	<p style=\"padding-left: 15px\">\r\n		1）乙方提前偿还部分借款，仍应向甲方支付全部借款利息。\r\n	</p>\r\n	<p style=\"padding-left: 15px\">\r\n		2）乙方提前偿还部分借款，仍应向丙方支付全部应付的借款管理费。\r\n	</p>\r\n	<p>\r\n		4、任何形式的提前还款不影响丙方向乙方收取在本协议第三条中说明的居间服务费。\r\n	</p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第六条	法律及争议解决\r\n	</p>\r\n	 <p>\r\n		 本协议的签订、履行、终止、解释均适用中华人民共和国法律，并由丙方所在地人民法院管辖。\r\n	</p>\r\n	<br/>\r\n	<p style=\"text-align: left;font-weight: 600;\">\r\n		第七条	附则\r\n	</p>\r\n	<p>\r\n		1、本协议采用电子文本形式制成，并永久保存在丙方为此设立的专用服务器上备查，各方均认可该形式的协议效力。\r\n	</p>\r\n	<p>\r\n		2、本协议自文本最终生成之日生效。\r\n	</p>\r\n	<p>\r\n		3、本协议签订之日起至借款全部清偿之日止，乙方或甲方有义务在下列信息变更三日内提供更新后的信息给丙方：本人、本人的家庭联系人及紧急联系人、工作单位、居住地址、住所电话、手机号码、电子邮箱、银行账户的变更。若因任何一方不及时提供上述变更信息而带来的损失或额外费用应由该方承担。\r\n	</p>\r\n	<p>\r\n		4、如果本协议中的任何一条或多条违反适用的法律法规，则该条将被视为无效，但该无效条款并不影响本协议其他条款的效力。\r\n	</p>\r\n</div>\r\n<br/>\r\n<div style=\"width: 98%;text-align: right;\">\r\n	<p>\r\n		2015年02月11日	</p>\r\n</div></div></div>','1423622182','1','1423622172','1404','','1','1','借款“贷款测试zj11”的电子协议！','0','0');
