INSERT INTO `%DB_PREFIX%deal_msg_list` VALUES ('4496','fanwe@fanwe.net','1','<p>尊敬的用户fanwe：&nbsp; </p>\r\n<p>遗憾的通知您，您于2015年02月12日发布的借款“11111”流标，您的本次借款行为失败。&nbsp;</p><p>您借款失败的可能原因为：&nbsp; </p>\r\n<br>\r\n<br>\r\n1. 您没能按时提交四项必要信用认证的材料。\r\n<br>\r\n<br>\r\n2. 您在招标期间没有筹集到足够的借款。&nbsp;&nbsp; \r\n<p>如果您属于认证未通过流标，为了您能够成功贷款，请凑齐申请贷款所需要的材料。您可以点击<a href=\"http://t2.fanwe.net/helpcenter\" target=\"_blank\">需要提供哪些材料？</a>来了解更多所需材料的详情。进行更多的信用认证将有助您获得更高的贷款额度。</p>\r\n<p>如果您属于招标到期流标，为了您能够成功贷款，请适度提高贷款利率，将有助您更快的获得贷款。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\r\n<p>点击 <a href=\"http://t2.fanwe.net/borrow\">这里</a>重新发布借款。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\r\n<p>感谢您对我们的支持与关注。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\r\n<p>p2p信贷&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\r\n<p>注：此邮件由系统自动发送，请勿回复！&nbsp; </p>\r\n<p>如果您有任何疑问，请您查看 <a href=\"http://t2.fanwe.net/helpcenter\" target=\"_blank\">帮助</a>，或访问 <a href=\"http://t2.fanwe.net\" target=\"_blank\">客服中心</a></p>\r\n<p>如果您觉得收到过多邮件，可以点击 <a href=\"http://t2.fanwe.net/uc_msg-setting\" target=\"_blank\">这里</a>进行设置\r\n&nbsp; </p>','1424027754','1','1424027328','44','','1','1','您的借款“11111”已流标！','0','0');
